%spark
//z.load("com.alibaba:fastjson:1.2.6");
val HDFSPath1 = z.angular("confirmPath1").toString
val HDFSPath2 = z.angular("confirmPath2").toString
val isDouble = z.angular("add").toString
val feature = z.angular("radioModel").toString
val rem1 = z.angular("remark1").toString
val rem2 = z.angular("remark2").toString
val date = new Date 
val now = date.toString.split(" ").dropRight(2).drop(1).mkString("-")  


object JSONHelper {
  def getJSONObjectArray(json: JSONObject, key: String): Array[JSONObject] = json.getJSONArray(key).toArray.map(_.asInstanceOf[JSONObject])
  def getStringArray(json: JSONObject, key: String): Array[String] = json.getJSONArray(key).toArray.map(_.toString)
}//fastJson Helper

if(isDouble=="true"){
    val a = sc.sequenceFile[String,String](HDFSPath1).map{case(key,value)=>(key,JSON.parseObject(value).getDouble(feature),rem1)}
    val b = sc.sequenceFile[String,String](HDFSPath2).map{case(key,value)=>(key,JSON.parseObject(value).getDouble(feature),rem2)}
    // val g = sc.sequenceFile[String,String]("hdfs://llscluster/tmp/zeppelin-auto-scorer/en-us-401-test1").map{case(key,value)=>(key,JSON.parseObject(value).getDouble(feature),"401")}
    val c = a.union(b)
    // .union(g)
    val e = c.toDF().registerTempTable("aaaa")
}else{
    val f = sc.sequenceFile[String,String](HDFSPath1).map{case(key,value)=>(key,JSON.parseObject(value).getDouble(feature),rem1)}
    f.toDF().registerTempTable("aaaa")
}
